state={
    questionBank:[]
}

getQuestions=()=>{
    quizService().then(question =>{
        console.log('question: ', question);
        this.setState({
            questionBank:question
        })
    })
}

    render(){
        return(
            <div className='container'>
                <div className='title'>Quiz App</div>
            </div>
        )
    }
}
